Defendant Nugene E Gilbert in court, in custody, with attorney Katie B. Kegel.   Jack A. Pitzo appeared for the State of Wisconsin.  Case called for sentence clarification of Count 5.  The defendant was sentenced as following:

COUNT 5:

6 month straight time consecutive to Counts 2 and 4.

FINE: $1,229.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

D/L REVOCATION: 12 months;

IGNITION INTERLOCK: 12 months.
